warning:
- O aluno deve levar para a área de treino, APENAS os materiais que serão usados no Wod;
 - Bolsas, mochilas, celulares, chaves e etc deverão ser guardados nos locais destinados para esta finalidade;
 - O aluno deve aguardar na recepção até o coach direciona-lo a área de treino;
 - Prazo limite para cancelamento do check-in é de 60 minutos antes do início da aula;
 - Prazo limite para entrada na aula em andamento é de 10 minutos (após esse tempo o aluno não poderá mais entrar na aula);
 - Mantenha uma distância segura dos seu colegas;
 - O aluno deverá realizar a higienização do material utilizado SEMPRE antes de guarda-lo;
 - Proibido circular pela Army! antes e após a aula;
 - Proibido o uso de celular e fones de ouvido durante o treino;
 - Trazer sua garrafa de água;
 - Área pet fechada. Não será permitido levar animais para o box;

